          "comment": "",
          "spotlight": "",
          "medical": [],
          "quotes": [
            {
              "date": "2024-07-03",
              "horse": "Jumeira Vision",
              "horse_id": "4914549",
              "race": "Visit racingtv.com Handicap",
              "race_id": "870311",
              "course": "Musselburgh",
              "course_id": "crs_416",
              "distance_f": "9",
              "distance_y": "1968",
              "quote": "Sam James gave Jumeira Vision him a wonderful ride, he was very tough but Sam did think he had a bit left in the tank at the finish. It was a bit of a shock when Jumeira Vision won last time, although Katie has always said he works well at home. It's more that the conditions haven't been right until now - Craig Talbot, owners' spokesperson."
            },
            {
              "date": "2024-06-22",
              "horse": "Jumeira Vision",
              "horse_id": "4914549",
              "race": "Woodsmith Construction Straight Mile 'Confined' Handicap (No Win In 2024) (Straight Mile Qualifier)",
              "race_id": "869261",
              "course": "Redcar",
              "course_id": "crs_1222",
              "distance_f": "8",
              "distance_y": "1759",
              "quote": "I didn't really go into it with any plan. Katie said Jumeira Vision had been working well at home but wasn't showing it on the track, so ride him as I found him. I put my hands on his neck and it worked out! Sometimes we make too much [of the rail bias], but I do think it's an advantage getting on to those tyre tracks. You're still not going to win if you don't have the horse, however, and he travelled well to get there in the first place - Sam James, rider, speaking to Racing TV."
            }
          ],
