            {
              "date": "2024-03-24",
              "horse": "Qitaal",
              "horse_id": "3781882",
              "race": "Injured Jockeys Fund Handicap",
              "race_id": "861248",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "10",
              "distance_y": "2243",
              "quote": "We trained Qitaal as a two-year-old but sadly at the time Shadwell were cutting back and sold all of our horses. I made as strong a case as I could that this was one they didn't want to be letting go of and when Robert Ng bought him I contacted them and asked if there was any chance this horse could stay with us. We think a lot of him. He went to Ireland and was only seen once in two years and when I saw his name in the Tattersalls August catalogue I thought I had to see him. He was a bit of a shell of the horse who left us but when he was making 4,000gns I couldn't leave him behind so I bought him back and threw him to the field for the rest of last year.  We've been bringing him back this spring, his work had been good and that wasn't a surprise, although I worried the ground might find him out after two years off. He's a horse we liked three years ago and now he's finally fulfilling that potential - Charlie Johnston, trainer."
            }
