          "medical": [],
          "quotes": [
            {
              "date": "2024-10-04",
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "race": "BetGoodwin Best UK Betting Site Novices' Hurdle (GBB Race)",
              "race_id": "875689",
              "course": "Fontwell",
              "course_id": "crs_520",
              "distance_f": "17.5",
              "distance_y": "3902",
              "quote": "It's great to see Reach For The Moon do it again under a penalty. He won unchallenged last time, so it was lovely to see how much resilience he had in battle. He hadn't had much luck since we've had him and he got carried out at Stratford in July, but he's got his confidence now. He'll hopefully be going to Cheltenham next - Jamie Snowden, trainer."
            },
            {
              "date": "2024-07-25",
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "race": "FBC Manby Bowdler Maiden Hurdle (ARC Summer Novices' Brush Hurdle Qualifier) (GBB Race) (Div I)",
              "race_id": "871107",
              "course": "Worcester",
              "course_id": "crs_2626",
              "distance_f": "16",
              "distance_y": "3520",
              "quote": "Luck hasn't necessarily been on his side. Reach For The Moon came back lame after getting bogged down at Sedgefield, he was fresh and free the second day and then he got carried out. He hasn't really had a chance to show himself but thankfully it worked out. He's got great aptitude for jumping and he's still unexposed as a hurdler. I'd like to think he can keep progressing with that win under his belt - Jamie Snowden, trainer."
            },
            {
              "date": "2021-09-11",
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "race": "Champagne Stakes (Group 2) (Colts & Geldings)",
              "race_id": "789166",
              "course": "Doncaster",
              "course_id": "crs_390",
              "distance_f": "7",
              "distance_y": "1546",
              "quote": "Frankie (Dettori) knew he was in trouble a long way out on the ground. He felt at the three it was already not the normal feel he gets from Reach For The Moon because the ground was dead. It's a pity we got that heavy rain yesterday. It's never easy to make all in a bit of a headwind over the straight seven. Better ground, better horse is all I can say. He'll probably have another run, it's only September. We'll find good ground somewhere - John Gosden, joint-trainer."
            },
            {
              "date": "2021-08-21",
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "race": "Betway Solario Stakes (Group 3)",
              "race_id": "789932",
              "course": "Sandown",
              "course_id": "crs_1404",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "They didn't go much pace and Frankie wanted to get on with it. I didn't think Reach For The Moon would go to the front that fast and go that far clear. He's done well and learned a lot racing up the Sandown hill on his own. He showed a bit of class I thought. You've got to look towards the autumn now and we'd like to wind up in one of those nice Group 1s. We'll see how he is over the next few days and make our decisions. He's very progressive and has done everything right - John Gosden, trainer."
            },
            {
              "date": "2021-07-16",
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "race": "bet365 EBF Novice Stakes (GBB Race) (Div II)",
              "race_id": "789544",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "7",
              "distance_y": "1540",
              "quote": "Reach For The Moon was entitled to do that, but there was no pace and he quickened well. It was a nice performance that will bring him on. He's a grand colt and we'll look to the Solario. He's quite playful and to that extent he should run in August. He'd be comfortable over a mile this year and over middle-distances next year - John Gosden, co-trainer."
            }
          ],
          "stable_tour": [
            {
              "horse": "Reach For The Moon",
              "horse_id": "3583193",
              "quote": "He's not back in from Sandringham yet but he's a serious horse and you don't get many rated as high as him from the Flat these days. He won the Group 3 Solario Stakes as a juvenile and was also second in a Group 2, and we'd look to start him over hurdles over two miles as you'd expect he'd have a bit of toe and class. 28-09-23"
            }
          ],
