          "quotes": [
            {
              "date": "2022-04-13",
              "horse": "Pull Again Green",
              "horse_id": "3073153",
              "race": "Citipost Novices' Hurdle (GBB Race)",
              "race_id": "807284",
              "course": "Cheltenham",
              "course_id": "crs_286",
              "distance_f": "20.5",
              "distance_y": "4456",
              "quote": "Pull Again Green did well at Newbury 13 days ago and we knew it was a quick turnaround, but when the ground dries up like this you can do things like that and he did very well today. He's very straightforward and I think the step up to three miles would bring about more improvement. He's benefited from brilliant placing and he had a January break for a month when he came to mine, which I think has been a big help - Paddy Brennan, jockey."
            },
            {
              "date": "2021-12-15",
              "horse": "Pull Again Green",
              "horse_id": "3073153",
              "race": "Betvictor Wishes Everyone A Merry Christmas EBF Stallions \"NH\" Novices' Hurdle (Qual') (GBB Race)",
              "race_id": "798289",
              "course": "Newbury",
              "course_id": "crs_936",
              "distance_f": "20.5",
              "distance_y": "4518",
              "quote": "Paddy said Pull Again Green wants to go left-handed and he had a few ideas, but then said to scrap them and keep it simple and aim for something at the end of the season. He wants nicer ground - it's lovely today and it's definitely his ground. We love him in every way; he goes well at home and his attitude is fantastic - Sally Randell, assistant trainer"
            }
          ],
