              "course_id": "crs_910",
              "distance_f": "21.5",
              "distance_y": "4709",
              "quote": "The change of scenery has done Jerrash good. This was a lot better race than the one he won at Bangor last time. We'll have three in the Summer Plate [at Market Rasen] now. This horse is still improving. He won off 118 but I can't see him going up that much - Peter Bowen, trainer, speaking to Racing TV."
