          "stable_tour": [
            {
              "horse": "Jerrash",
              "horse_id": "3952100",
              "quote": "I think this horse has a very big future and is one to keep an eye out for. He ran a lovely third to Our Jester (won valuable Lingfield bumper since) on his debut at Ascot and he came on a ton for that experience as he showed late last month at Ascot when winning nicely over 2m5Â½f on his hurdling debut. I am not sure how strong the opposition was but he could only do what he did. He must go forward from that but it will be baby steps, nothing to hot too soon. Cheltenham is out of the question as those races are now closed, which is no bad thing. We will take our time as he could be quite smart. 02-02-22"
            }
          ],
